      out.write("\t\t\t{\"tag\":\"td\", \"html\":\"<input type='text' value='$\\{name\\}' class='config_name pointer' style='background-color:#ddd'>\"},\n");
      out.write("\t\t\t{\"tag\":\"td\", \"html\":\"$\\{capturexml\\}\", \"class\":\"capture_xml\"},\n");
