      out.write("\t\t\t{\"tag\":\"td\", \"html\":\"$\\{updated\\}\"},\n");
      out.write("\t\t]\n");
      out.write("};\n");
      out.write("\n");
      out.write("function fill_config_data(to, result) {\n");
      out.write("//\tconsole.log(result);\n");
      out.write("\t_val(to, \"enable\", result.enable).change();\n");
      out.write("\t_val(to, \"desc\", result.desc);\n");
      out.write("\t_val(to, \"key\", result.key);\t\n");
      out.write("\t_val(to, \"dwell\", result.dwell);\n");
      out.write("//\t_val(to, \"delay\", result.delay);\n");
      out.write("\t_val(to, \"channel\", result.channel);\n");
      out.write("//\t_val(to, \"type\", result.type);\n");
      out.write("//\t_val(to, \"subtype\", result.subtype);\n");
      out.write("\t_val(to, \"frametype\", result.type+\"\"+parseInt(result.subtype).toString(16));\n");
      out.write("\t_id(to, \"frametype\").trigger(\"chosen:updated\");\n");
      out.write("\t\n");
      out.write("\tif (!_isnull(result.fromds) && !_isnull(result.tods)) {\n");
      out.write("\t\t_val(to, \"ds\", result.fromds+\"\"+result.tods).change();\n");
      out.write("\t}\n");
      out.write("\t\n");
      out.write("\tvar addrtype;\n");
      out.write("\tswitch (_int(result.addrCount)) {\n");
      out.write("\tcase 1:\n");
      out.write("\t\t_val(to, \"addr1_da\", result.da);\n");
      out.write("\t\taddrtype = \"addr1\";\n");
      out.write("\t\tbreak;\n");
      out.write("\tcase 2:\n");
      out.write("\t\t_val(to, \"addr2_da\", result.da);\n");
      out.write("\t\t_val(to, \"addr2_sa\", result.sa);\n");
      out.write("\t\taddrtype = \"addr2\";\n");
      out.write("\t\tbreak;\n");
      out.write("\tcase 3:\n");
      out.write("\t\t_val(to, \"addr3_bssid\", result.bssid);\n");
      out.write("\t\t_val(to, \"addr3_da\", result.da);\n");
      out.write("\t\t_val(to, \"addr3_sa\", result.sa);\n");
      out.write("\t\taddrtype = \"addr3\";\n");
      out.write("\t\tbreak;\n");
      out.write("\tcase 4:\n");
      out.write("\t\t_val(to, \"addr4_ra\", result.ra);\n");
      out.write("\t\t_val(to, \"addr4_ra\", result.ta);\n");
      out.write("\t\t_val(to, \"addr4_da\", result.da);\n");
      out.write("\t\t_val(to, \"addr4_sa\", result.sa);\n");
      out.write("\t\taddrtype = \"addr4\";\n");
      out.write("\t\tbreak;\n");
      out.write("\tdefault:\n");
      out.write("\t\t_val(to, \"any_addr\", result.anyAddr);\n");
      out.write("\t\t_val(to, \"ap\", result.ap);\n");
      out.write("\t\t_val(to, \"sta\", result.sta);\n");
      out.write("\t\tif (!_isnull(result.anyAddr)) {\n");
      out.write("\t\t\taddrtype = \"any_addr\";\t\n");
      out.write("\t\t} else if (!_isnull(result.ap) || !_isnull(result.sta)) {\n");
      out.write("\t\t\taddrtype = \"apsta\";\n");
      out.write("\t\t} else {\n");
